text:
LE PRESIDENT DE LA REPUBLIQUE,
VU la Constitution;
VU la loi n°2002/009 du 30 décembre 2002 autorisant le Président de la République à ratifier la Convention pour l'Unification de certaines règles relatives au transport aérien international, adoptée à Montréal le 28 mai 1999 ;
DECRETE:
Art. 1er —  Est ratifiée la Convention pour l'Unification de certaines règles relatives au transport aérien international, adoptée à Montréal le 28 mai 1999.
Art. 2 —  Le présent décret sera enregistré et publié suivant la procédure d'urgence, puis inséré au Journal Officiel en français et en anglais.
